import React from 'react';
import './FooterBottom.css';

function FooterBottom() {
  return (
     <>
        <div className='footerbottom'>
            <div className='footerbottom-container'>
                <div className='footerbottom-conteudo'>
                    <p>teste</p>
                </div>
            </div>
        </div>
     </>
    );
}

export default FooterBottom;
